import Sort from './Controls';

interface Props {
  onShow:() => void;
  statusAdd:boolean;
  onSort:(sort: string) => void;
}

const Header: React.FC<Props> = ({onShow, statusAdd, onSort}) => {
  return (
    <header>
        <h1>My calendar</h1>
        <button onClick={onShow}>{ statusAdd ? 'Close' : 'Add'}</button>
        <Sort onSort='{onSort}' />
    </header>
  )
}

export default Header
